// SPDX-Lisence-Identifier: MIT
pragma solidity ^0.8.19;

contract test {

    //  
    // solidity   
    // ( ) (  ) ( )
    address internal owner;
    uint internal count;
    
    //  
    //        
    constructor() {
        //    owner.
        //     msg.sender
        owner = msg.sender;
        count = 0;
    }

    //  :    . 
    // js json  . 
    struct user_info{
        string name;
        uint8 age;
        string birth;
    }
    //   
    // {'name' : ????, 'age' : ????, 'brith' : ????}

    // mapping  
    // {key : value, key2 : value2, key3 : value3, .....}
    // key  string, address, uint
    // value  string, addres, uint, [], struct
    mapping(address => user_info) internal users;

    //  
    address[] public user_list;

    // modifier 
    //   ->   
    modifier onlyOwner{
        // transaction    owner   
        require(owner == msg.sender, "Only owner can call funtion");
        _;
    }
    modifier count_user{
        _;
        count++;
    }

    function add_user(
        address _wallet, 
        string memory _name, 
        uint8 _age, 
        string memory _birth
    ) public onlyOwner count_user {
        // mapping  
        users[_wallet].name = _name;
        users[_wallet].age = _age;
        users[_wallet].birth = _birth;
        //    
        user_list.push(_wallet);
    }

    function view_user(
        address _wallet
    ) public view returns (
        string memory, 
        uint8, 
        string memory
    ){
        return (
            users[_wallet].name, 
            users[_wallet].age, 
            users[_wallet].birth
        );
    }
}
